internals.generate = function () {

  /**
   * elements separated by forward slash ("/") are alternatives.
   */
  const or = '|';

  /**
   * DIGIT = %x30-39 ; 0-9
   */
  const digit = '0-9';
  const digitOnly = '[' + digit + ']';

  /**
   * ALPHA = %x41-5A / %x61-7A   ; A-Z / a-z
   */
  const alpha = 'a-zA-Z';
  const alphaOnly = '[' + alpha + ']';

  /**
   * cidr       = DIGIT                ; 0-9
   *            / %x31-32 DIGIT         ; 10-29
   *            / "3" %x30-32           ; 30-32
   */
